INSERT INTO `lpe_matrixcontent_itemtab` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_item_descriptiontab`, `field_item_subtitletab`, `field_item_additionalNotes1`, `field_item_titletab`, `field_item_additionalNotes2`, `field_item_additionalNotes3`) VALUES
(1, 93, 1, '2020-01-05 04:21:39', '2020-05-30 01:39:49', '2e915aaa-ebad-431a-a99d-1376b84584f1', '<p>Là một đơn vị luôn thuộc top đầu các doanh nghiệp cung cấp <strong>dịch vụ tư vấn môi trường</strong>, <a href=\"https://moitruonghopnhat.com/\">xử lý môi trường</a>, chúng tôi luôn hoàn thiện và mang đến cho khách hàng một dịch vụ tối ưu nhất về các vấn đề sau:</p><ul><li>Giải pháp tiết kiệm chi phí – phù hợp nhất và không phát sinh chi phí</li><li>Báo giá rõ ràng và công khai</li><li>Cung cấp đầy đủ các thủ tục – hồ sơ pháp lý theo đúng quy định của bộ luật bảo vệ môi trường</li><li>Cập nhật nhanh nhất và chính xác nhất về các điều luật, nghị định mới nhất</li><li>Hỗ trợ khách hàng 24/24 với đội ngũ nhân viên giàu kinh nghiệm, nhiệt tình nhất</li></ul>', 'Sự chuyên nghiệp mang đến dịch vụ tốt nhất', 'Dự toán chi phí', 'Quy trình', 'Cam kết giá cả', 'Tư vấn hỗ trợ 24/24'),
(3, 104, 1, '2020-01-05 04:33:57', '2020-05-30 01:39:49', '34450c68-45bd-4e87-ad36-47986e1b8973', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
(140, 1463, 1, '2020-04-09 20:09:30', '2020-05-30 01:39:49', '46da71d5-77cf-41c8-910b-d6b045a798a6', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
(142, 1471, 1, '2020-04-09 20:09:30', '2020-04-09 20:09:30', '371bd1dd-23b8-4542-8b22-4cec4d9a0822', '<p>Khâu thiết kế giúp định hình phong cách, mang lại vẻ đẹp và giá trị thẩm mỹ cho ngôi nhà. Kiến trúc sư là những người hiểu và nắm vững về địa hình, vật tư xây dựng ngôi nhà, đem đến cho khách hàng sự lựa chọn tốt ưu, đảm bảo tiết kiệm chi phí nhất có thể. Đồng thời, kiến trúc sư còn hoạch định, đưa ra dự toán cụ thể về chi phí chi tiêu cho công trình thi công nhằm điều chỉnh phương án thiết kế sao cho phù hợp nhất với điều kiện kinh tế của từng gia chủ.</p>', 'Tiết kiệm tối đa chi phí cho công trình xây dựng', 'Cam kết chi phí thiết kế', 'Chi phí', 'Cam kết chi phí vật tư', 'Cam kết chi phí tư vấn'),
(143, 1472, 1, '2020-04-09 20:09:31', '2020-04-09 20:09:31', 'd26c6f90-1ec6-40eb-adf0-bcd618b3708d', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
(144, 1473, 1, '2020-04-09 20:09:31', '2020-04-09 20:09:31', '5daf4323-cb24-438e-b9d7-ba6417e91633', '<p>Một bộ hồ sơ thiết kế kỹ thuật thi công công trình xây dựng bao gồm bốn phần. Trong đó, phần khai toán vật tư là bản dự toán chi tiết nhất chi phí bạn cần bỏ ra để hoàn thiện cho ngôi nhà.<br />Công ty kiến trúc sẽ gợi ý và tư vấn cho bạn những sản phẩm phù hợp với điều kiện kinh tế, nguồn gốc. Tiết kiệm được thời gian cho việc tìm hiểu sản phẩm, giá cả, thương hiệu trong thời điểm thị trường đa dạng mọi mặt hàng về mẫu mã, giá cả và chất lượng.</p>', 'Dự toán chi phí xây dựng', NULL, 'Dự toán chi phí xây dựng', NULL, 'Additional Notes 3 icon'),
(145, 1474, 1, '2020-04-09 20:09:31', '2020-04-09 20:09:31', 'c00798b1-ff07-4bae-a190-b831a75ff615', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', NULL, 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
(146, 1475, 1, '2020-04-09 20:09:31', '2020-04-09 20:09:31', '50874d77-a96f-442f-8cea-4a26417167ee', '<p>Kết cấu điện và nước được kiến trúc sư xem xét và quản lí cẩn thận nhằm mang đến một bộ hồ sơ thiết kế kỹ thuật đầy đủ từ phần móng, thân, mái tới từng lớp bố trí sắt, thép, gạch ngói, xi măng,… mang đến kết cấu vững chắc, không hao phí, vừa an toàn, lại bền bỉ theo thời gian.</p><p>Việc xem phong thủy về hướng nhà, hướng phòng, nội thất trong nhà, vị trí đặt phòng ngủ của gia chủ theo cung,… đều được đội ngũ kiến trúc sư tính toán sao cho hợp nhất với gia chủ nhằm xua đuổi điềm xấu, mang lại tài lộc, may mắn cho gia chủ.</p>', 'Phương án hợp lý, an toàn và hợp phong thủy', NULL, 'Phương án hợp lý, an toàn và hợp phong thủy', NULL, NULL),
