(155, 1511, 1, '2020-04-09 20:17:13', '2020-04-09 20:17:13', '632b4ee2-7f57-4833-b2e1-54a43af61777', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
(156, 1521, 1, '2020-04-09 20:18:29', '2020-04-09 20:18:29', 'e12fe312-0430-4e3e-981e-d63c5b19c444', '<p>Khâu thiết kế giúp định hình phong cách, mang lại vẻ đẹp và giá trị thẩm mỹ cho ngôi nhà. Kiến trúc sư là những người hiểu và nắm vững về địa hình, vật tư xây dựng ngôi nhà, đem đến cho khách hàng sự lựa chọn tốt ưu, đảm bảo tiết kiệm chi phí nhất có thể. Đồng thời, kiến trúc sư còn hoạch định, đưa ra dự toán cụ thể về chi phí chi tiêu cho công trình thi công nhằm điều chỉnh phương án thiết kế sao cho phù hợp nhất với điều kiện kinh tế của từng gia chủ.</p>', 'Tiết kiệm tối đa chi phí cho công trình xây dựng', 'Dự toán chi phí xây dựng', 'Chi phí', 'Cam kết chi phí vật tư', 'Cam kết chi phí tư vấn'),
(157, 1522, 1, '2020-04-09 20:18:29', '2020-04-09 20:18:29', 'b0d81534-f2c2-4549-8b23-59943d1e77da', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
(158, 1523, 1, '2020-04-09 20:18:29', '2020-04-09 20:18:29', '195fbe4f-717a-469a-ac4e-2c42c711c265', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
