(175, 1625, 1, '2020-04-13 00:05:38', '2020-04-13 00:05:38', '300a0bd0-7099-4eca-b33e-4b480c0f0de4', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
(176, 1626, 1, '2020-04-13 00:05:38', '2020-04-13 00:05:38', 'e8495841-7e72-47e9-bfc4-57c37f682ab1', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
