(193, 1718, 1, '2020-04-13 22:53:06', '2020-04-13 22:53:06', '05da2243-b292-4baf-96a8-23d15338dac3', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
