(220, 1846, 1, '2020-04-16 05:38:52', '2020-04-16 05:38:52', 'f561a520-78b5-4459-ba77-f9855151673f', '<p>Khâu thiết kế giúp định hình phong cách, mang lại vẻ đẹp và giá trị thẩm mỹ cho ngôi nhà. Kiến trúc sư là những người hiểu và nắm vững về địa hình, vật tư xây dựng ngôi nhà, đem đến cho khách hàng sự lựa chọn tốt ưu, đảm bảo tiết kiệm chi phí nhất có thể. Đồng thời, kiến trúc sư còn hoạch định, đưa ra dự toán cụ thể về chi phí chi tiêu cho công trình thi công nhằm điều chỉnh phương án thiết kế sao cho phù hợp nhất với điều kiện kinh tế của từng gia chủ.</p>', 'Tiết kiệm tối đa chi phí cho công trình xây dựng', 'Dự toán chi phí xây dựng', 'Chi phí', 'Cam kết chi phí vật tư', 'Cam kết chi phí tư vấn'),
(221, 1847, 1, '2020-04-16 05:38:52', '2020-04-16 05:38:52', '0ef724e5-b031-4478-8122-35e84e388839', '<p>Bạn phân vân liệu những ý tưởng của bạn có liên kết được với nhau và phù hợp với thực tế hay không? Kiến trúc sư sẽ là người ngồi lắng nghe ý tưởng, cách sống và sinh hoạt,… của gia đình và vẽ ra những mô hình nhà ở phù hợp với yêu cầu của bạn.<br />Bạn chỉ cần trình bày những ý tưởng mà bản thân mong muốn và kiến trúc sư sẽ giúp bạn thực hiện cũng như đưa ra những giải pháp tối ưu nhất.</p>', 'Mô hình hóa ý tưởng của bạn', 'Đưa ý tưởng thành hiện thực', 'Mô hình hóa', NULL, NULL),
(222, 1848, 1, '2020-04-16 05:38:52', '2020-04-16 05:38:52', '3215f355-b775-4216-8ca4-ab79d23fa5b1', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
(223, 1858, 1, '2020-04-16 05:39:44', '2020-04-16 05:39:44', 'c3dcf25f-0732-4796-a851-4863ef8e59d5', '<p>Khâu thiết kế giúp định hình phong cách, mang lại vẻ đẹp và giá trị thẩm mỹ cho ngôi nhà. Kiến trúc sư là những người hiểu và nắm vững về địa hình, vật tư xây dựng ngôi nhà, đem đến cho khách hàng sự lựa chọn tốt ưu, đảm bảo tiết kiệm chi phí nhất có thể. Đồng thời, kiến trúc sư còn hoạch định, đưa ra dự toán cụ thể về chi phí chi tiêu cho công trình thi công nhằm điều chỉnh phương án thiết kế sao cho phù hợp nhất với điều kiện kinh tế của từng gia chủ.</p>', 'Tiết kiệm tối đa chi phí cho công trình xây dựng', 'Dự toán chi phí xây dựng', 'Chi phí', 'Cam kết chi phí vật tư', 'Cam kết chi phí tư vấn');
