(291, 2120, 1, '2020-06-07 05:11:31', '2020-06-07 05:11:31', 'fd134531-c5d3-4c8b-84da-b0a98e81b38e', '<p>Từ khâu lên ý tưởng để triển khai thực tế đến hình thức đưa ra phương án, cách thức bố trí, kiến trúc sư luôn đảm bảo được những yêu cầu, tiêu chuẩn đề ra của gia chủ và hợp lý với khuôn viên đất của gia đình kèm theo một số yếu tố khác. Từ đó, kế hoạch xây dựng ngôi nhà với chi phí, công năng sẽ được phát huy ở mức tốt nhất.</p>', 'Quy trình làm việc chuyên nghiệp', 'Phương án hợp lý, an toàn và hợp phong thủy', 'Quy trình làm việc chuyên nghiệp', NULL, NULL),
